import { ApiProperty } from '@nestjs/swagger';
import {
  IsString,
  IsNotEmpty,
  IsOptional,
  MaxLength,
  IsObject,
  IsUrl,
  IsDateString,
  IsBase64,
} from 'class-validator';

export class Company {
  @ApiProperty({
    type: String,
    example: 'a1b2c3d4-e5f6-7890-abcd-ef1234567890',
    description: 'unique id',
  })
  @IsNotEmpty()
  @IsString()
  id: string;

  @ApiProperty({ example: '' })
  @IsString({ message: 'Name must be a string' })
  @IsNotEmpty({ message: 'Name must not be empty' })
  @MaxLength(45, { message: 'Name must be 45 characters' })
  name: string;

  @ApiProperty({ example: '576666665956/0001-81' })
  @IsString({ message: 'CNPJ must be a string' })
  @IsNotEmpty({ message: 'CNPJ must not be empty' })
  cnpj: string;

  @ApiProperty({ example: 'Tech company' })
  @IsString({ message: 'Description must not be empty' })
  @IsOptional()
  description?: string;

  @ApiProperty({
    example:
      'data:image/png;base64,',
  })
  @IsOptional()
  @IsBase64()
  @IsString()
  logoImg?: string;

  @ApiProperty({ example: '' })
  @IsOptional()
  @IsObject({ message: 'company business hours' })
  businessHours?: Record<string, any>;

  @ApiProperty({ example: '' })
  @IsString()
  @IsNotEmpty()
  stripeAccountId: string;

  @ApiProperty({
    example: '2024-01-15T10:30:00Z',
    description: 'Creation date',
  })
  @IsDateString()
  createdAt: Date;

  @ApiProperty({
    example: '2024-01-15T10:30:00Z',
    description: 'Update date',
  })
  @IsDateString()
  updatedAt: Date;
}
